import React from "react";

import StarRatings from "react-star-rating";

const ProductItem = ({ product }) => {
  return (
    <div class="col-sm-12 col-md-6 col-lg-3 my-3">
      <div class="card p-3 rounded">
        <img
          class="card-img-top mx-auto"
          src={product?.images[0]?.url}
          alt={product?.name}
        />
        <div class="card-body ps-3 d-flex justify-content-center flex-column">
          <h5 class="card-title">
            <a href="">{product?.name}</a>
          </h5>
          <div class="ratings mt-auto d-flex">
            <div class="star-ratings">
              <i class="fa fa-star star-active"></i>
              <i class="fa fa-star star-active"></i>
              <i class="fa fa-star star-active"></i>
              <i class="fa fa-star star-active"></i>
              <i class="fa fa-star star-active"></i>
            </div>
            <span id="no_of_reviews" class="pt-2 ps-2">
              {" "}
              {product?.noOfReviews}
            </span>
          </div>
          <p class="card-text mt-2">${product?.price}</p>
          <a href="" id="view_btn" class="btn btn-block">
            View Details
          </a>
        </div>
      </div>
    </div>
  );
};

export default ProductItem;
